import './App.css';
import AppHeader from "./components/AppHeader";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import Home from "./pages/Home";

function App() {

    return (
        <>
            <AppHeader/>
            <div className='md:container md:mx-auto'>
                <Router>
                    <div>
                        <Switch>
                            <Route path="/" exact>
                                <Home/>
                            </Route>
                            <Route path='*'>
                                <h1 className='text-center'>Not found page</h1>
                            </Route>
                        </Switch>
                    </div>
                </Router>
            </div>

        </>
    );
}

export default App;
